import React from 'react';
import Header from './components/Header';
import TransitDetail from './components/TransitDetail';
import './css/custom.css';


function App() {
    return (
      <div >
          <div>
              <Header/>
          </div>           
          <div>
              <TransitDetail
                  cost = {162}
                  amount = {5652}
                  profit = {91}                  
              ></ TransitDetail>
          </div>            
      </div>       
);
}

export default App;
